__NUXT_JSONP__("/page/2", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y,z,A,B,C,D,E,F,G,H,I,J,K){return {data:[{works:{contents:[{id:"hikarikato-logo",createdAt:m,updatedAt:n,publishedAt:m,revisedAt:n,title:"Hikari Kato \u002F Logo",category:[{id:k,createdAt:c,updatedAt:c,publishedAt:c,revisedAt:c,name:l}],release:f,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F1de3e2108d87478cbd7129f6b63cb6fd\u002Fhikarikatologo_1.jpg",height:d,width:e},overview:"カトウヒカリ\u002FHikari Katoのロゴを制作しました。\n\n名前本来の響きを大切にし、余計なものを無くした洗練した印象のデザインに仕上げました。"},{id:"kawaiit-select-radio-namecard",createdAt:o,updatedAt:p,publishedAt:o,revisedAt:p,title:"Kawaiiは元気になる 加藤望のオトナカワイイKawaiit select \u002F Name Card",category:[{id:g,createdAt:a,updatedAt:a,publishedAt:a,revisedAt:a,name:h}],release:f,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F3749223437d1453bbc39930bde24dae0\u002Fkawaiitradioname_1.jpg",height:d,width:e},overview:"Shibuya Cross-FMで毎週水曜日21時から生放送を行っている、渋谷のど真ん中からKawaiiと元気を発信する番組「Kawaiiは元気になる 加藤望のオトナカワイイKawaiit select」様の名刺を制作させていただきました。\n\nロゴでも使われている三色の色を組み合わせて動きのあるアクティブなデザインに仕上げました。"},{id:"kawaiit-select-webshop",createdAt:q,updatedAt:r,publishedAt:q,revisedAt:r,title:"Kawaiit select \u002F Web Shop",category:[{id:i,createdAt:b,updatedAt:b,publishedAt:b,revisedAt:b,name:j}],release:f,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fd97e66dfdd64413d9c6fcef5f4810850\u002Fkawaiitshop_1.jpg",height:d,width:e},overview:"オトナカワイイをコンセプトに 輸入商品、リメイク品、ハンドメイド品を集めているセレクトショップ Kawaiit select様のウェブショップを制作させていただきました。\n\n公式サイトのデザインに合わせて統一感を出しています。スマホからのユーザーを配慮してシンプルで使いやすいUIデザインになるよう心掛けました。\n\nアイテムの管理・更新・運用のしやすさを配慮して、カラーミーショップを使用したレスポンシブWebデザインで構築しました。"},{id:"kawaiit-select-webshop-logo",createdAt:s,updatedAt:t,publishedAt:s,revisedAt:t,title:"Kawaiit select WEB SHOP \u002F Logo",category:[{id:k,createdAt:c,updatedAt:c,publishedAt:c,revisedAt:c,name:l}],release:f,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fece9e4d85f1540298f0c23a4b187c510\u002Fkawaiitwebshop_1.jpg",height:d,width:e},overview:"オトナカワイイをコンセプトに 輸入商品、リメイク品、ハンドメイド品を集めているセレクトショップ Kawaiit select様のウェブショップのロゴを制作させていただきました。\n\nウェブショップのリニューアルに伴い、現在の印象を残しながら文字の調整をしました。"},{id:"greetingcard2016",createdAt:u,updatedAt:v,publishedAt:u,revisedAt:v,title:"2016年 申年賀状",category:[{id:g,createdAt:a,updatedAt:a,publishedAt:a,revisedAt:a,name:h}],release:w,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F752048daaea5403c9a34c8aeceb09303\u002F2016-800x500.jpg",height:x,width:y},overview:"このたび翔泳社並びに、グループ会社全体の年賀状として採用していただきました。",textlink1:"https:\u002F\u002Fwww.shoeisha.co.jp\u002F"},{id:"hikarikato-photolog",createdAt:z,updatedAt:A,publishedAt:z,revisedAt:A,title:"Hikari Kato \u002F Photolog",category:[{id:i,createdAt:b,updatedAt:b,publishedAt:b,revisedAt:b,name:j}],release:f,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F7c80047b38f04e2593c1b76427662327\u002Fhikarikato_1.jpg",height:d,width:e},overview:"カトウヒカリ\u002FHikari Katoのフォトログを制作しました。\n\n白を基調にシンプルでクリーンなデザインに仕上げました。Instagramと連動して投稿が反映されるようにしています。\n\n更新のしやすさを配慮して、WordPressを使用したレスポンシブWebデザインで構築しました。"},{id:"kawaiit-select-radio-web",createdAt:B,updatedAt:C,publishedAt:B,revisedAt:C,title:"Kawaiiは元気になる 加藤望のオトナカワイイKawaiit select \u002F Website",category:[{id:i,createdAt:b,updatedAt:b,publishedAt:b,revisedAt:b,name:j}],release:w,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F3d9dc3e4dffe428d94eb436b6b14ee48\u002Fkawaiitradio-web_1.jpg",height:d,width:e},overview:"Shibuya Cross-FMで毎週水曜日21時から生放送を行っている、渋谷のど真ん中からKawaiiと元気を発信する番組「Kawaiiは元気になる 加藤望のオトナカワイイKawaiit select」様のウェブサイトを制作させていただきました。\n\n元気でアクティブなラジオのイメージをロゴで使われている「青」、「ピンク」、「イエロー」を使って表現しました。Kawaiitラジオの看板でも使われている「+」と「×」を掛けあわせたパターンデザインを背景で使用しました。\n\nスマホ・タブレットに対応したレスポンシブWebデザインで構築しました。"},{id:"kawaiit-select-radio",createdAt:D,updatedAt:E,publishedAt:D,revisedAt:E,title:"Kawaiiは元気になる 加藤望のオトナカワイイKawaiit select",category:[{id:k,createdAt:c,updatedAt:c,publishedAt:c,revisedAt:c,name:l},{id:g,createdAt:a,updatedAt:a,publishedAt:a,revisedAt:a,name:h}],release:"2015-05-31T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fb89a3b05a6e142d49d6ee03f3912a215\u002Fkawaiitradio_1.jpg",height:d,width:e},overview:"Shibuya Cross-FMで毎週水曜日21時から生放送を行っている、渋谷のど真ん中からKawaiiと元気を発信する番組「Kawaiiは元気になる 加藤望のオトナカワイイKawaiit select」様の全体のデザイン、アートディレクションを担当させていただきました。\n\n加藤望さんの今までのバックグラウンドである「音楽」とお店のコンセプトである「オトナカワイイ」を掛け合わせたデザインを考えました。"},{id:"kawaiit-select-web",createdAt:F,updatedAt:G,publishedAt:F,revisedAt:G,title:"Kawaiit select \u002F Website",category:[{id:i,createdAt:b,updatedAt:b,publishedAt:b,revisedAt:b,name:j}],release:H,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F5b17e35a8a264d1e9396d36410d95028\u002Fkawaiit_1.jpg",height:d,width:e},overview:"オトナカワイイをコンセプトに 輸入商品、リメイク品、ハンドメイド品を集めているセレクトショップ Kawaiit select様のウェブサイトを制作させていただきました。\n\n「いつもカワイイの中にいる」お店のイメージをデザインに込めました。ショップカード・名刺同様、お店のブランドカラーで統一感を出しています。\n\n「オトナカワイイ」と「リゾート感」をキーワードに配色やレイアウトを決め、やわらかな女性らしいデザインになりました。\n\nニュース、ブログ、アイテムの更新のしやすさを配慮して、WordPressを使用したレスポンシブWebデザインで構築しました。"},{id:"kawaiit-select-namecard",createdAt:I,updatedAt:J,publishedAt:I,revisedAt:J,title:"Kawaiit select \u002F Name Card",category:[{id:g,createdAt:a,updatedAt:a,publishedAt:a,revisedAt:a,name:h}],release:H,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F09119b585caf4a5bb67474556207e36b\u002Fkawaiit-namecard_1-800x500.jpg",height:x,width:y},overview:"オトナカワイイをコンセプトに 輸入商品、リメイク品、ハンドメイド品を集めているセレクトショップ Kawaiit select様の名刺を制作させていただきました。\n\n「いつもカワイイの中にいる」お店のイメージと、やわらかい雰囲気の人柄をデザインに込めました。ショップカード同様、お店のブランドカラーで統一感を出しています。\n\n角丸加工の処理を施し、初対面の方へやわらかい印象を残す形に仕上がりました。\n\n※2015.03 増刷に伴い一部内容を変更しました。"}],totalCount:66,offset:K,limit:K},page:"2",pager:[0,1,2,3,4,5,6]}],fetch:{},mutations:void 0}}("2022-01-09T02:20:56.340Z","2022-01-09T02:17:01.218Z","2022-01-09T02:19:08.407Z",670,1080,"2016-01-31T15:00:00.000Z","graphic","Graphic","web","Web","logo","Logo","2022-01-08T10:25:10.195Z","2022-01-09T08:34:12.501Z","2022-01-08T10:26:36.387Z","2022-01-09T08:35:13.270Z","2022-01-08T10:27:49.716Z","2022-01-09T08:35:42.203Z","2022-01-08T10:29:18.687Z","2022-01-09T08:36:27.250Z","2022-01-08T10:30:46.334Z","2022-01-09T08:37:02.932Z","2015-12-31T15:00:00.000Z",500,800,"2022-01-08T10:23:53.116Z","2022-01-09T08:37:41.854Z","2022-01-08T10:41:33.089Z","2022-01-09T08:39:21.945Z","2022-01-08T12:04:51.020Z","2022-01-09T08:40:14.948Z","2022-01-08T12:06:50.186Z","2022-01-09T08:40:48.472Z","2015-04-30T15:00:00.000Z","2022-01-08T12:08:24.824Z","2022-01-09T08:41:10.993Z",10)));